// src/components/sections/Skills.jsx
import React, { useState } from "react";
import { useTheme } from "../../context/ThemeContext";

const Skills = () => {
  const { darkMode } = useTheme();
  const [activeTab, setActiveTab] = useState("frontend");

  // Donn√©es int√©gr√©es directement dans le composant
  const skillsData = {
    frontend: {
      title: "Frontend Development",
      icon: "üé®",
      skills: ["React.js", "Vue.js", "JavaScript/TypeScript", "HTML5/CSS3", "Tailwind CSS"],
      description: "Conception d'interfaces utilisateur modernes et r√©actives avec les technologies web les plus r√©centes."
    },
    backend: {
      title: "Backend Development",
      icon: "‚öôÔ∏è",
      skills: ["Node.js", "Python", "SQL/NoSQL", "RESTful APIs", "GraphQL"],
      description: "D√©veloppement de services robustes et √©volutifs avec une infrastructure backend solide et performante."
    },
    tools: {
      title: "Tools & Others",
      icon: "üõ†Ô∏è",
      skills: ["Git/GitHub", "Docker", "CI/CD", "UI/UX Design", "Agile/Scrum"],
      description: "Utilisation d'outils et de m√©thodologies qui optimisent le flux de travail et garantissent des livrables de qualit√©."
    }
  };

  // Fonction pour g√©n√©rer des couleurs de tags bas√©es sur la cat√©gorie
  const getTagColor = (category) => {
    const colors = {
      frontend: darkMode ? "bg-blue-900/30 text-blue-300 border-blue-700" : "bg-blue-50 text-blue-700 border-blue-200",
      backend: darkMode ? "bg-purple-900/30 text-purple-300 border-purple-700" : "bg-purple-50 text-purple-700 border-purple-200",
      tools: darkMode ? "bg-teal-900/30 text-teal-300 border-teal-700" : "bg-teal-50 text-teal-700 border-teal-200"
    };
    return colors[category];
  };

  return (
    <section
      id="skills"
      className={`section-content min-h-screen py-24 ${
        darkMode ? "bg-gray-900" : "bg-gray-50"
      }`}
    >
      <div className="container mx-auto px-4">
        <div className="max-w-4xl mx-auto">
          <div className="text-center mb-16">
            <h2 className={`text-4xl md:text-5xl font-bold mb-6 ${darkMode ? "text-white" : "text-gray-900"}`}>
              Expertise Technique
            </h2>
            <p className={`max-w-2xl mx-auto text-lg ${darkMode ? "text-gray-300" : "text-gray-600"}`}>
              Fort d'une expertise technique approfondie et d'un sens aigu du design, 
              je d√©veloppe des applications web modernes et performantes.
            </p>
          </div>

          {/* Navigation par onglets */}
          <div className={`flex justify-center mb-12 border-b ${darkMode ? "border-gray-700" : "border-gray-200"}`}>
            {Object.entries(skillsData).map(([key, value]) => (
              <button
                key={key}
                onClick={() => setActiveTab(key)}
                className={`py-4 px-6 text-lg font-medium border-b-2 transition-all ${
                  activeTab === key
                    ? `${darkMode ? "text-white border-blue-500" : "text-blue-600 border-blue-500"}`
                    : `${darkMode ? "text-gray-400 border-transparent hover:text-gray-300" : "text-gray-500 border-transparent hover:text-gray-700"}`
                }`}
              >
                <span className="mr-2">{value.icon}</span>
                {value.title}
              </button>
            ))}
          </div>

          {/* Contenu de l'onglet actif */}
          <div className={`rounded-xl shadow-lg overflow-hidden ${darkMode ? "bg-gray-800" : "bg-white"}`}>
            <div className={`p-8`}>
              <div className="flex items-start mb-8">
                <span className="text-4xl mr-4">{skillsData[activeTab].icon}</span>
                <div>
                  <h3 className={`text-2xl font-bold mb-2 ${darkMode ? "text-white" : "text-gray-900"}`}>
                    {skillsData[activeTab].title}
                  </h3>
                  <p className={`${darkMode ? "text-gray-300" : "text-gray-600"}`}>
                    {skillsData[activeTab].description}
                  </p>
                </div>
              </div>

              <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-8">
                {skillsData[activeTab].skills.map((skill, index) => (
                  <div 
                    key={index} 
                    className={`p-4 rounded-lg border ${getTagColor(activeTab)} transition-all duration-300 transform hover:-translate-y-1 hover:shadow-md`}
                  >
                    <div className="flex items-center">
                      <div className={`w-3 h-3 rounded-full mr-3 ${
                        activeTab === "frontend" ? "bg-blue-500" :
                        activeTab === "backend" ? "bg-purple-500" : "bg-teal-500"
                      }`}></div>
                      <span className="font-medium">{skill}</span>
                    </div>
                  </div>
                ))}
              </div>

              <div className={`mt-12 p-6 rounded-lg ${darkMode ? "bg-gray-700/50" : "bg-gray-50"}`}>
                <h4 className={`text-lg font-semibold mb-2 ${darkMode ? "text-white" : "text-gray-800"}`}>
                  Exp√©rience professionnelle
                </h4>
                <p className={`${darkMode ? "text-gray-300" : "text-gray-600"}`}>
                  {activeTab === "frontend" && "Plus de 5 ans d'exp√©rience dans le d√©veloppement d'interfaces utilisateur modernes et r√©actives pour des projets web et mobiles."}
                  {activeTab === "backend" && "Conception et impl√©mentation de nombreuses API et services backend pour des applications √† haute disponibilit√© et √† forte charge."}
                  {activeTab === "tools" && "Ma√Ætrise des outils de d√©veloppement modernes et m√©thodologies agiles pour optimiser les workflows et la qualit√© des livrables."}
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
